  base: *id013
  body: "When compiling a `.grpc.cc` file generated by `protoc.exe` with `grpc_cpp_plugin.exe`,\
    \ the following error would show up:\r\n```\r\nPlease compile grpc with _WIN32_WINNT\
    \ of at least 0x600 (aka Windows Vista)\r\n```\r\nIt seems that the generated\
    \ file somehow includes `port_platform.h`, which checks `_WIN32_WINNT` before\
    \ including `windows.h`, which includes `sdkddkver.h`, which in turn defines `_WIN32_WINNT`.\
    \ This PR moves the inclusion of `windows.h` before checking `_WIN32_WINNT` in\
    \ this header file.\r\n\r\nThis patch is the same as https://github.com/grpc/grpc/pull/14574,\
    \ and might be the same error described in https://github.com/grpc/grpc/issues/14575."
